import React from "react";
import {Buttons, TextBox, UploadButton, TextArea} from "../../../shared/components";
import "../../.././assets/index.css";

const CreatePost = (onSubmitHandler, onChangeHandler)=>{

    return (
        <div className="createPost">
            <form onSubmit={onSubmitHandler}>
                <div className="createPost-text">
                    <TextBox inputType="text" placeholder="Start Writing Post..."/>
                </div>
                <div className="createPost-buttons">
                    <UploadButton />
                    <Buttons type="submit"value="Done"/>
                </div>
            </form>
        </div>
    );
}

export default CreatePost;
